import React, { Component } from 'react'

export class Test2 extends Component {
    state ={

        value1 : 'Defalt'

    }

    change =(event) =>{
        this.setState({
            value1: event.target.value,

        })
    }

    render() {
        return (
            <div>
                <form >

                <input type="text" name="value1" onSubmit={this.change}/>
                <input type="submit"/>
             </form>
                <p>{this.state.value1} </p>
            </div>
        )
    }
}

export default Test2
